function TableMarket(props) {
  let data = props.data;


  const columns = [{
    dataField: 'id',
    text: 'Product ID'
  }, {
    dataField: 'name',
    text: 'Product Name'
  }, {
    dataField: 'price',
    text: 'Product Price'
  }];

  const options = {
    custom: true,
    totalSize: products.length
  };

  return(
    <div>

    <PaginationProvider
      pagination={ paginationFactory(options) }
